const Index = ({ todoItems }) => {
  return todoItems.map((item) => {
    const { id, name, description } = item;
    return (
      <table>
        <tr key={id}>
          <td>{id}</td>
          <td>{name}</td>
          <td>{description}</td>
          <td>
            <button>Update</button>
          </td>
        </tr>
      </table>
    );
  });
};

export default Index;
